import React from 'react'

const styles = {
    backgroundColor: "#060809",
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "calc(10px + 2vmin)",
    color: "white",
    paddingLeft: "50px",
    paddingRight: "50px"
}

const NGClogo = {
    /* identical to box height */

    // font-family: Retroica;
    fontStyle: "normal",
    fontWeight: "bold",
    fontSize: "144px",
    lineHeight: "144px",
    letterSpacing: "-0.2em",
    color: "#FF9601",
}

const logo = {
    display: "flex",
    height: "200px",
    marginBottom: "10px"
}

const Home = () => {
    return (
        <div style={styles}>
            {/* <img src={`./assets/NGC-logo.png`} style={logo}/> */}
            <h1 style={NGClogo}>NG<span style={{color: "white"}}>C</span></h1>
            <h3 style={{color: "#FF9601"}}>NEAR <span style={{ color: "#fff" }}>GANG COUTURE</span></h3>
            <p style={{textAlign: 'center', width: "70%", fontSize: '19px', lineHeight: '27px'}}>NEAR Gang Couture is an NFT brand that aims to build a premiere community of Haute Gang members in the NEAR Protocol that is for the community, by the community. It has its roots in PFP-based projects, character creators, and the fashion industry.</p>
        </div>
    )
}

export default Home
